// src/cli/services/commands/search.test.ts
init_cjs_shims();
vi.mock("@shopify/cli-kit/node/system");
describe("searchService", () => {
  test("the right URL is open in the system when a query is passed", async () => {
    await searchService("deploy app");
    globalExpect(openURL).toBeCalledWith("https://shopify.dev?search=deploy+app");
  });
  test("the right URL is open in the system when a query is not passed", async () => {
    await searchService();
    globalExpect(openURL).toBeCalledWith("https://shopify.dev?search=");
  });
});
